import React from 'react'
import TeamCard from './TeamCard'
import $ from "jquery" 
export default function Team() {
  const codeContent = document.querySelector('.code-content');

  codeContent.addEventListener('keydown', (event) => {
    const keyCode = event.keyCode || event.which;
  
    // If enter key is pressed
    if (keyCode === 13) {
      event.preventDefault();
      const newLine = document.createElement('br');
      const lineNumber = document.createElement('span');
      lineNumber.classList.add('line-number');
      lineNumber.textContent = codeContent.children.length + 1;
      const lineContent = document.createElement('span');
      lineContent.classList.add('line-content');
      lineContent.contentEditable = true;
      const lineDiv = document.createElement('div');
      lineDiv.appendChild(lineNumber);
      lineDiv.appendChild(lineContent);
      codeContent.appendChild(lineDiv);
      codeContent.appendChild(newLine);
      lineContent.focus();
    }
  });
  
  return (
    
    <div className='team_wrapper'>
      <div className='team_container_head'>
        <h2>Meet our team of <span>creators</span>, designers, and world-class problem <span> solvers</span></h2>
        <p>Dont miss my friends.</p>

        <div className='spider_web_arrow'>
          <div className='indicate_arrow'>
            <svg viewBox="0 0 100 100">
              <path d="M20 30 Q40 30, 30 55 T89 50 M90 46 L95 48 L90 53" stroke-width="1" fill="none" />
            </svg>
          </div>
        </div>
      </div>
      <div class="code-box">
  <div class="code-content" contenteditable="true">
    <span class="line-number"></span><span class="line-content" contenteditable="true"></span><br/>
  </div>
</div>




      <div className='team_container'>
        <TeamCard />
        <TeamCard />
        <TeamCard />
        <TeamCard />
        <TeamCard />
        <TeamCard />
        <TeamCard />
        <TeamCard />
      </div>
    </div>
  )
}
